--------------------------------------------------------
--  DDL for View VW_RELATORIO_SALARIOS
--------------------------------------------------------

  CREATE OR REPLACE FORCE NONEDITIONABLE VIEW "SYSTEM"."VW_RELATORIO_SALARIOS" ("PESSOA_ID", "NOME", "CARGO", "SALARIO_BRUTO", "DESCONTOS", "SALARIO_LIQUIDO") AS 
  SELECT ps.pessoa_id, ps.nome, c.nome AS cargo, ps.salario_bruto, ps.descontos, ps.salario_liquido
  FROM pessoa_salario ps
  JOIN pessoa p ON p.id = ps.pessoa_id
  JOIN cargo c ON c.id = p.cargo_id
;
REM INSERTING into SYSTEM.VW_RELATORIO_SALARIOS
SET DEFINE OFF;
